function draw() {
    viewHeight = document.documentElement.clientHeight - document.getElementById('chart').getBoundingClientRect().top -10;
    viewWidth = document.getElementById('chart').getBoundingClientRect().width - 10;

	// limit the minimum possible size and subtract margins
    height = d3.max([viewHeight, minHeight]) - margin.top - margin.bottom;
    width = d3.max([viewWidth, minWidth]) - margin.left - margin.right;
    radius = Math.min(width, height) / 2;

function computeTextRotation(d) {
  var angle = x(d.x + d.dx / 2) - Math.PI / 2;
  angle =  angle / Math.PI * 180;
  return angle > 90 ? angle - 180 : angle;
}

function nodeColor(d) {
  if (d.depth == 0) { return "#ffffff" }
  else {
    if (d.depth == 1 ) { return color(d.code) }
	else {
      var nodeColorScale = d3.scale.linear()
	    .domain([1, d.depth + 1])
	    .range([ "#ffffff", nodeColor(d.parent)]);
	     return nodeColorScale(d.depth);
    }
  }
}

function arcZoom(d) { 
    d3.selectAll('.node').select('text').transition().attr("display", "none");
    d3.selectAll('.node').select('.shape').transition()
	.duration(500)
	.attrTween('d', arcTween(d))
	.each("end", function(e, i) {
		//http://grokbase.com/t/gg/d3-js/138ez3r5wd/zoomable-sunburst-text-alignment
		// check if the animated element's data e lies within the visible angle span given in d
		if (e.x >= d.x && e.x < (d.x + d.dx)) {
			// get a selection of the associated text element
			var arcText = d3.select(this.parentNode).select("text");
			// add the text element and recalculate positions
			arcText.transition().duration(0)
	        .attr("transform", function(d) { 
              return "translate(" + arc.centroid(d) + ")rotate(" + computeTextRotation(d) + ")";
              })
	  	    .attr('display', function(e) { return ((e.dx/d.dx) > .02) ? null : 'none' ;});
		}
	});
}

// Interpolate the scales: http://bl.ocks.org/mbostock/4348373
function arcTween(d) {
  var xd = d3.interpolate(x.domain(), [d.x, d.x + d.dx]),
      yd = d3.interpolate(y.domain(), [d.y, 1]),
      yr = d3.interpolate(y.range(), [d.y ? 20 : 0, radius]);
  return function(d, i) {
    return i
        ? function(t) { return arc(d); }
        : function(t) { x.domain(xd(t)); y.domain(yd(t)).range(yr(t)); return arc(d); };
  };
}

function debounce(fn, wait) {
// From: http://colingourlay.github.io/presentations/reusable-responsive-charts-with-d3js/#/54
	var timeout;

    return function () {
        var context = this,              // preserve context
            args = arguments,            // preserve arguments
            later = function () {        // define a function that:
                timeout = null;          // * nulls the timeout (GC)
                fn.apply(context, args); // * calls the original fn
            };

        // (re)set the timer which delays the function call
        clearTimeout(timeout);
        timeout = setTimeout(later, wait);
    };
}

});
